	        if (x.indexOf('_:') === 0) {
	          if (bnodes[x]) {
	            subject = bnodes[x]
	          } else {
	            subject = store.bnode(x)
	            bnodes[x] = subject
	          }
	        } else {
	          subject = store.sym(x)
	        }
